<template>
  <div>

  </div>
</template>

<script>
import jsPDF from 'jspdf'
import 'jspdf-autotable'
export default {
  props:['headers', 'table', 'title'],
  computed: {
    head() {
      const arr = []
      this.headers.forEach(header => {
        arr.push(header.text)
      })
      return arr
    },
    data() {
      const arr = []
      var i = 1
      this.table.logs.forEach(row => {
        const column = []
        this.headers.forEach(header => {
          if(header.value === 'createdAt' || header.text === 'Tanggal') { column.push(this.$options.filters.date(row[header.value].seconds * 1000)) }
          else { column.push(row[header.value]) }
        })
        column.splice(0, 0, i)
        i++
        arr.push(column)
      })
      return arr
    }
  },
  mounted() {
    const vm = this
    var imgData =
      "data:image/png;base64,"

    var doc = new jsPDF()

    doc.addImage(imgData, "JPEG", 10, 12, 29, 16)
    doc.setFontSize("20")
    doc.setFontStyle("bold")
    doc.text(`${vm.title} (${vm.table.ktp})`, 105, 20, null, null, "center")
    doc.setFontSize("14")
    doc.setFontStyle("normal")
    doc.text("Jl. Lambung Mangkurat, No. 4, Banjarmasin", 105, 27, null, null, "center")
    doc.setFontSize("12")
    doc.text("0511-3350189", 105, 33, null, null, "center")

    doc.text("Nama", 14, 50)
    doc.text(": " + vm.table.name, 40, 50)
    doc.text("KTP", 14, 56)
    doc.text(": " + vm.table.ktp, 40, 56)
    doc.text("No. HP", 14, 62)
    doc.text(": " + vm.table.nohp, 40, 62)
    doc.text("Alamat", 14, 68)
    doc.text(": " + vm.table.address, 40, 68)

    doc.text("Tanggal Input", 120, 50)
    doc.text(": " + vm.$options.filters.date(vm.table.createdAt.seconds * 1000), 160, 50)
    doc.text("Paket", 120, 56)
    doc.text(": " + vm.table.package, 160, 56)
    doc.text("STO", 120, 62)
    doc.text(": " + vm.table.sto, 160, 62)

    vm.head.splice(0, 0, "#")
    doc.autoTable({
      startY: 73,
      head: [vm.head],
      body: vm.data,
    })
    //let finalY = doc.previousAutoTable.finalY; //this gives you the value of the end-y-axis-position of the previous autotable.
    //doc.text("Text to be shown relative to the table", 12, finalY + 10); //you use the variable and add the number of pixels you want it to move.
    doc.save(`${vm.title} (${vm.table.ktp}).pdf`)

    // Set the document to automatically print via JS
    //doc.autoPrint();

  }
}
</script>

